import React, { useEffect, useRef, useState } from "react";
import { Table } from 'react-bootstrap';
import '@mapbox/mapbox-gl-draw/dist/mapbox-gl-draw.css';
import '../../style/map.css';
import axios from "axios";
import { Apiurl } from '../../services/apirest';

export function MapBusesEdit(props) {

  const [routes, setRoute] = useState(null);
  useEffect(() => {
    let url = Apiurl + "/api/users/" + this.username + "/routes"
    axios.get(url)
      .then(res => {
        setRoute(res.data);
        const new_obj = document.createElement('div');
        new_obj.innerHTML = "hola";
        document.querySelector('.tableContainer tbody').appendChild(new_obj);
      })
  }, [routes]);
  return (
  <Table striped bordered hover className="tableContainer">
    <thead>
      <tr>
        <th>id</th>
        <th>Line</th>
        <th>View</th>
        <th>Accion</th>
      </tr>
    </thead>
    <tbody>
    </tbody>
  </Table>
  );
};
